__NUXT_JSONP__("/drugs/Mesmulogene_Ancovacivec", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1246525-59-6",chebiId:b,chemicalFormula:b,definition:"A bivalent cancer vaccine comprised of a modified vaccinia virus Ankara (MVA) strain encoding human mucin 1 (MUC1) and interleukin-2 (IL-2) with potential immunostimulating and antineoplastic activities. Originally developed for the eradication of smallpox, MVA is a highly attenuated and replication-defective strain incapable of virion assembly and exerts potent immunostimulatory activity against antigens. Vaccination with mesmulogene ancovacivec may stimulate the host immune system to mount a humoral and cytotoxic T lymphocyte (CTL) responses against tumor cells expressing MUC1, a tumor associated antigen, resulting in tumor cell lysis. Expression of IL-2 augments the specific CTL response against MUC1 expressing cells.",fdaUniiCode:"WQQ9XZH2CC",identifier:"C2241",preferredName:c,semanticType:"Immunologic Factor",subclassOf:["C1962","C2313"],synonyms:["MESMULOGENE ANCOVACIVEC","MVA-MUC1-IL2","MVA-MUC1-IL2 Vaccine",c,"Modified Vaccinia Ankara Encoding Human MUC-1 Antigen and Interleukin-2 Suspension","TG4010"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMesmulogene_Ancovacivec",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Mesmulogene_Ancovacivec","","Mesmulogene Ancovacivec","2021-10-30T13:37:24.623Z")));